/*SECONDAUTO DB*/
create database SECONDAUTO;

USE SECONDAUTO;

/*creazione delle tabelle*/

CREATE TABLE PROPRIETARI (
    COD_FISCALE VARCHAR(16) NOT NULL,
	TARGA VARCHAR(10) NOT NULL,
    CITTA_RESIDENZA VARCHAR(45),
    REGIONE VARCHAR(45),
    NOME_COGNOME VARCHAR(45),
    ANNO_ACQUISTO DATE,
    ANNO_VENDITA DATE,
    PRIMARY KEY (COD_FISCALE, TARGA),
    FOREIGN KEY (TARGA) REFERENCES AUTO(TARGA)
);

CREATE TABLE CONCESSIONARIA (
    PARTITA_IVA VARCHAR(45) NOT NULL PRIMARY KEY,
    CITTA VARCHAR(45),
    NOME_CONCESSIONARIA VARCHAR(45),
    INDIRIZZO VARCHAR(45),
    TELEFONO VARCHAR(15),
    RESPONSABILE VARCHAR(45)
);

CREATE TABLE AUTO (
    MARCA VARCHAR(45) CHECK (MARCA IN ('Fiat' , 'Volkswagen', 'Mercedes', 'Audi')),
    MODELLO VARCHAR(25),
    TARGA VARCHAR(10) NOT NULL PRIMARY KEY,
    COLORE VARCHAR(45),
    CILINDRATA_CC INT,
    CAMBIO VARCHAR(45),
    PREZZO DECIMAL(10 , 2 ),
    PARTITA_IVA VARCHAR(45) NOT NULL,
    FOREIGN KEY (PARTITA_IVA)
        REFERENCES CONCESSIONARIA (PARTITA_IVA)
);



